describe('parse index', function () {
  it('convert a formated MRC file', function (done) {
    // make sure we have barcodes we need
    index.parseMrc.loadBarcodes('test/barcode.test.txt', () => {
      H(new marc.Iso2709Reader(fs.createReadStream('./test/marcs/test_a_lot_of_items.mrc')))
        .map((record) => {
          record = index.parseMarc2SCSB(record)
          record.bNumber.should.equal('.b100186026')
          record.xml.should.be.type('string')
          record.xml.length.should.be.above(50000)
        })
        .done((record) => {
          done()
        })
    })
  })
  it('convert to SCSB fromat from sierra API responses', function (done) {
    // make sure we have barcodes we need
    index.parseMrc.loadBarcodes('test/barcode.test.txt', () => {
      var record = index.parseSierraApi2SCSB(aBib, items)
      record.bNumber.should.equal('.b117910272')
      record.xml.should.be.type('string')
      record.xml.length.should.be.above(20000)
      done()
    })
  })
})
